import parseImageString from "../../helperFunctions/parseImageString";

import "./general.scss";


export default function HomePage() {
    const backgroundURL = parseImageString('/static/images/')

    return (
        <div className="home-page" 
        styles={{backgroundImage: "url('/static/images/denny_bnb_homepage.jpeg')"}}>
               <ContentCard style={{width: "60%"}}>
                    <PageTitle
                    title={"Denny B&B"}
                    subtitle={"Like Airbnb But Shittier \u2122"}
                    style={{color: 'ghostwhite'}}
                    />
                    <Button
                        to={"/list"}
                        style={{height: "30px"}}
                    >
                    View All Houses
                    </Button>
               </ContentCard>
        </div>
    );
}
